import React, { Component } from 'react';
import { Avatar } from 'antd';
import './Profile.style.scss';

export default class Profile extends Component {
  render() {
    return (
      <div className="profile">
        <div className="profile__main animated bounceIn">
          <div className="profile__main__header">
            <Avatar size={70} src="https://spon.mdp.ac.id/pluginfile.php/1/theme_moove/marketing1icon/1582524735/icon-lecture.png" />
            <div className="profile__main__header__info">
              <span className="profile__main__header__user__name">Tue Vo</span>
              <span className="profile__main__header__user__role">Manager</span>
            </div>
          </div>
        </div>
      </div>
    )
  }
}
